import {BrowserRouter as Router, 
	Switch,
	Route,
	Link 
	} from "react-router-dom";
import './App.css';

function App() {
	return (
		<Router>
		<div className='App'>
			<header className='App-header'>  
				<ul>
				 	<li><Link to="/"> Hello there </Link> </li>

				</ul>
			</header>
		</div>
		</Router>
	);
}

export default App;
